import React from "react";
import { DefaultSection } from "../../section";
import TeamCard from "./card";
import styled from "styled-components";

const CardContainer =  styled("div")`
display: flex;
flex-direction: row;
justify-content: center;
`;

const contents = [{
    id: "1",
    img: require("../../../assets/icons/corporate-1.png"),
    title: "Marketing Team",
    content: 'Set your own trip terms, create cost centers, and control budget allocation.'
},
{
    id: "2",
    img: require("../../../assets/icons/corporate-1.png"),
    title: "Customer Services Team",
    content: 'Set your own trip terms, create cost centers, and control budget allocation.'
},
{
    id: "3",
    img: require("../../../assets/icons/corporate-1.png"),
    title: "Call Center Team",
    content: 'Set your own trip terms, create cost centers, and control budget allocation.'
}
];

const AboutUsContent = () => {
    return (
        <>
            <DefaultSection>
                <CardContainer>
                {contents.map((content) => (

                    <TeamCard key={content.id} content={content} />

                ))}
                </CardContainer>

            </DefaultSection>
        </>
    );
}

export default AboutUsContent;
